package com.quantum_guys.dncc_eco_sync.models;import java.io.Serializable;public class ScannedData implements Serializable {    String stsId;    String key;    public ScannedData(String stsId, String key) {        this.stsId = stsId;        this.key = key;    }    public String getStsId() {        return stsId;    }    public String getKey() {        return key;    }}